import { motion } from "framer-motion"

function StreamPage(){
    return <div class="StreamPageMainDiv">
        <motion.div 
        drag="x"
        dragConstraints={{ left: -100, right: 100 }}
        whileHover={{ scale: 1.1 }}
        whileTap={{ scale: 0.9 }}
            children={
                <h3 style={{textAlign:"center"}}><h1 style={{display:"inline",color:"#6209b6"}}>S</h1>tream <h1 style={{display:"inline",color:"#6209b6"}}>P</h1>age</h3>
            }
        />
        
        <center>
            <div class="Dashboard">
                <h3>
                    Dashboard
                </h3>
            </div>
        </center>
    </div>;
}


export default StreamPage;
